import './IngredientInput.css';
import mascotteBiscottine from '../assets/mascotte.png';
import LogoInputIngredient from '../assets/logo.png';
import LogoHeader from '../assets/logo.png';
import mascotteHeader from '../assets/mascotte.png';





function ingredientInput() {

   



    return (

        <div className="encadrementIngredientInput">
<div className='encadrementHeader'>
    <div className="encadrementTete"> 
        <ul>
    <img className='mascotteHeader' src={mascotteHeader} alt='' />
    <img className='titreHeader' src={LogoHeader} alt='' />
   
        <ol>Toute les recettes</ol>
        <ol>Mes recette</ol>
    </ul>
</div>




        </div>
</div>
    )
};


export default ingredientInput;
